    const properDirectory = `../../public//${country}.jpg`
    console.log(properDirectory)
    const imageErrorCatch = () =>{
        return(
            <h1></h1>
        )
    }
    return(
        <div>
            {country}
            <br>
            </br>
            {start} - {end}
            <br/>
            {caption}
            <img src={properDirectory} onError={imageErrorCatch}/>
        </div>
    )

}
